 <script>
    let temp='';
    $( document ).ready(function() {
      var svg = d3.select("svg")
      /*svg.call(d3.zoom().on("zoom", function () {
      svg.attr("transform", d3.event.transform)
 }))*/

var paths = svg.selectAll('path')
paths.attr("fill", "red")
paths.on("click", function(d){
  console.log("veamos", d3.select(this).attr("class"));
})
paths.on("mouseover", function(d) {
  temp =  d3.select(this).attr("fill");
  let name = d3.select(this).attr("class")
  //name = name.split(" ")[0].slice(4, name.length)
  d3.select("#svg_675").text(name)
  if(temp === "red"){
    d3.select(this).attr("fill", "DarkRed")
  }
  if(temp === "blue"){
    d3.select(this).attr("fill", "DarkBlue")
  }
  if(temp === "gray"){
    d3.select(this).attr("fill", "DarkGray")
  }
})

paths.on("mouseout", function(d) {
  d3.select(this).attr("fill", temp)
  })
});
    $( window ).on( "load", function() {
      fetch("https://zen.grupoiclar.com/api/lotespinares?etapa=10")
      .then((response)=>{
        return response.json()
      })
      .then((val)=>{
        val.lotes.forEach((lote)=>{
          let item = d3.select("svg").select(`path.l${lote.lote}${lote.manzana.toLowerCase()}`);
          if(lote.estatus === 0 && lote.preciopormetro ===0 ){
            item.attr("fill", "blue");
          }
          if(lote.estatus === 0){
            item.attr("fill", "gray");
          }
          else{
            item.attr("fill", "red")
          }
        })
      })
    });
    </script>
